settings._cssCustom:
.fr-note {
  padding: var(--card-padding, var(--space-m));
  border-radius: var(--card-radius, var(--radius));
  background: var(--warning-light, #FDEBB5);
  color: var(--warning-ultra-dark, #544002);
  margin-inline: auto;
}

.fr-note * + :is(h2, h3, h4) {
  margin-top: var(--heading-spacing);
  color: var(--text-dark);
}

.fr-note a {
  text-decoration: underline;
}

.footer-amsterdam a {
  color: var(--text-light-muted);
}

.footer-amsterdam a:hover {
  color: var(--text-light);
}

.fr-feature-card-foxtrot {
	--icon-size: 1.5em;
  --icon-color: var(--neutral);
}

.fr-feature-card-foxtrot :is(svg, i) {
  color: var(--icon-color);
  height: var(--icon-size);
  width: var(--icon-size);
}

.footer-amsterdam-main__left::after {
  content: '';
  position: absolute;
  right: calc(var(--space-xxl) * -.5);
  width: 1px;
  height: 100%;
  background-color: var(--text-light-muted);
}

settings._cssCustom:tablet_portrait:
.footer-amsterdam-main__left::after {
  right: unset;
  bottom: calc(var(--space-xxl) * -.5);
  width: 100%;
  height: 1px;
}

settings._cssCustom:
.footer-amsterdam-main__form {
  flex-wrap: nowrap;
  gap: .5em;
}

.footer-amsterdam-main__form .bricks-button {
  transition: var(--transition);  
}

.footer-amsterdam-main__form.footer-amsterdam-main__form .form-group {
	margin-block-end: 0;
}
